        [Fact]
        public async Task PostRequest_WithKeyword1_UrlSmokeball_Response_OK_TestAsync()
        {
            mockAnalyzrService = new Mock<AnalyzrService>(mockSearch1Service.Object);
            submitController = new SubmitController(mockAnalyzrService.Object, controllerLogger.Object);
            var data = new SearchParams { Keywords = keyword1, Url = "www.smokeball.com.au" };

            var result = await submitController.PostRequest(data);

            var actionResult = Assert.IsType<ActionResult<AnalyzrResult>>(result);
            var actionValue = Assert.IsType<OkObjectResult>(actionResult.Result);
            actionValue.Value.Should().BeEquivalentTo(new AnalyzrResult { Positions = new List<int> { 2 } });
        }

